import { HANDLE_INIT_PRODUCT,  HANDLE_INIT_PRODUCT_INNER } from "./constants";
export const handleInitProduct = payload => {
    return {
        payload: payload,
        type: HANDLE_INIT_PRODUCT
    }
}
export const handleInitProductInner = payload => {
    return {
        payload: payload,
        type: HANDLE_INIT_PRODUCT_INNER
    }
}
